import React from "react";
import { responsive } from "./responsive.js";
export default class Cpp extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive.dsa.Main()}
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',this.resize);
    }
    resize(){
        this.setState({style:responsive.dsa.Main()})
    }
    render(){
        return (
            <button style={this.state.style} onClick={()=>{this.props.func()}}>
                <p>
                C++
                </p>
             <p style={responsive.dsa.text()}>
                CPP is a low level programming language developed which is considered as one of the fastest compiled programing language
                take mock test on pointers,templates,OOP's and various topics on CPP
            </p>
            </button>
        )
    }
}
